import { useEffect, useState } from "react";
import Header from "../components/Header";
import TradeForm from "../components/TradeForm";
import TradeList from "../components/TradeList";
import { fetchHello, fetchTime, fetchTrades } from "../api/api";

export default function Dashboard() {
  const [message, setMessage] = useState("Loading...");
  const [time, setTime] = useState("Loading...");
  const [trades, setTrades] = useState([]);

  // For price fetch (HTTP)
  const [symbol, setSymbol] = useState("");
  const [priceData, setPriceData] = useState(null);

  // For live stream (WebSocket)
  const [liveSymbol, setLiveSymbol] = useState("");
  const [livePrice, setLivePrice] = useState(null);
  const [ws, setWs] = useState(null);

  // Suggested crypto symbols
  const cryptoSuggestions = [
    "BINANCE:BTCUSDT",
    "BINANCE:ETHUSDT",
    "BINANCE:SOLUSDT",
    "BINANCE:XRPUSDT",
    "BINANCE:ADAUSDT",
  ];

  // Initial backend fetch
  useEffect(() => {
    fetchHello().then((d) => setMessage(d.message));
    fetchTime().then((d) => setTime(d.server_time));
    fetchTrades().then((d) => setTrades(d));
  }, []);

  // Fetch Price (HTTP API)
  const getMarketPrice = async () => {
    if (!symbol) return;

    const res = await fetch(`/api/price?symbol=${symbol}`);
    const data = await res.json();
    setPriceData(data);
  };

  // Start Live Streaming via WebSocket
  const startStreaming = () => {
    if (!liveSymbol) {
      alert("Enter a symbol to stream");
      return;
    }

    if (ws) {
      ws.close();
    }

    const socket = new WebSocket(`ws://localhost:8080/api/live?symbol=${liveSymbol}`);

    socket.onopen = () => {
      console.log("Connected to backend WS");
    };

    socket.onmessage = (event) => {
      try {
        const data = JSON.parse(event.data);

        if (data.type === "trade" && data.data && data.data.length > 0) {
          setLivePrice(data.data[0].p); // Last price
        }
      } catch (err) {
        console.error("WS parse error:", err);
      }
    };

    socket.onclose = () => {
      console.log("WebSocket closed");
    };

    setWs(socket);
  };

  // Stop streaming
  const stopStreaming = () => {
    if (ws) {
      ws.close();
      setWs(null);
      setLivePrice(null);
    }
  };

  return (
    <div style={{ padding: 20 }}>
      <Header />

      <p>{message}</p>
      <p>Server Time: {time}</p>

      <hr />

      {/* PRICE FETCH SECTION */}
      <h2>üîç Get Market Price (HTTP)</h2>

      <input
        type="text"
        placeholder="Enter Symbol e.g. AAPL or BINANCE:BTCUSDT"
        value={symbol}
        onChange={(e) => setSymbol(e.target.value)}
        style={{ marginRight: 10 }}
      />

      <button onClick={getMarketPrice}>Get Price</button>

      {priceData && (
        <pre
          style={{
            marginTop: 20,
            padding: 15,
            background: "#f0f0f0",
            borderRadius: 5,
          }}
        >
          {JSON.stringify(priceData, null, 2)}
        </pre>
      )}

      <hr />

      {/* LIVE STREAM SECTION */}
      <h2>üì° Live Price Stream (WebSocket)</h2>

      <div style={{ marginBottom: 10 }}>
        <strong>Crypto Suggestions:</strong>
        {cryptoSuggestions.map((coin) => (
          <button
            key={coin}
            style={{ margin: 5 }}
            onClick={() => setLiveSymbol(coin)}
          >
            {coin}
          </button>
        ))}
      </div>

      <input
        type="text"
        placeholder="Enter Symbol for Live Stream"
        value={liveSymbol}
        onChange={(e) => setLiveSymbol(e.target.value)}
        style={{ marginRight: 10 }}
      />

      <button onClick={startStreaming} style={{ marginRight: 10 }}>
        ‚ñ∂Ô∏è Start Streaming
      </button>

      <button onClick={stopStreaming} style={{ marginRight: 10 }}>
        ‚èπ Stop
      </button>

      {livePrice && (
        <h3 style={{ marginTop: 20 }}>
          Live Price ({liveSymbol}): <span style={{ color: "green" }}>{livePrice}</span>
        </h3>
      )}

      <hr />

      {/* TRADES SECTION */}
      <TradeForm setTrades={setTrades} />
      <TradeList trades={trades} />
    </div>
  );
}
